import { Container, Typography } from "@mui/material";
import React from "react";
const DataHolder = () => {
  return (
    <React.Fragment>
      <Container>
        <Typography>Todo DataHolder</Typography>
      </Container>
    </React.Fragment>
  );
};

export default DataHolder;
